import React from "react";
import DeleteIcon from '@material-ui/icons/Delete';

const ListComp = (props) =>{

     
          return (
               <> 
                <div className="todo_style">
                  <span onClick={remove}><DeleteIcon/></span>
                    <li>{props.text}</li>
                </div>
               </>
          )
}

export default ListComp
